import { FunctionComponent, useCallback, useEffect, useState } from "react";
import styles from "../../Consultas/ConsultaUsuario/Css/ModalUsuario.module.css";
import CssModais from "../../Consultas/CssGeral/Modais.module.css";
import PortalPopup from "../../Components/PortalPopup";

type ModalUsuarioType = {
  Mensagem: string;
};
const Mensagem: FunctionComponent<ModalUsuarioType> = ({Mensagem}) => {

    const [isModalUsuarioPopupOpen, setModalUsuarioPopupOpen] = useState(true);

    const closeModalUsuarioPopup = useCallback(() => {
        setModalUsuarioPopupOpen(false);
      }, []);
      
    useEffect(() => {       
    });
  return (
    <>
      {isModalUsuarioPopupOpen && (
        <PortalPopup
              overlayColor="rgba(113, 113, 113, 0.3)"
              placement="Top center"
              onOutsideClick={closeModalUsuarioPopup}
            >
            <div id="Modal" className={styles.modalUsuarioDiv + " " + CssModais.ModalPequeno}>
                <div className={CssModais.TamanhoModal}>
                    <div className={CssModais.Nav}> 
                        {Mensagem}
                    <button className={CssModais.ButtonClose} onClick={closeModalUsuarioPopup}>
                        <img src="../ImagensModais/ImgCloseModal.svg" />
                    </button>
                    </div>
                    <div className={CssModais.Div}></div>
                    <div className={CssModais.Body}>
                    Body
                    </div>
                    <div className={CssModais.Footer}>
                    Footer
                    </div>
                </div>
            </div>
        </PortalPopup>
      )}
    </>
  ); 
  
};
export default Mensagem;
